import React from 'react';
import './projects.css';
import Iframe from 'react-iframe'

export class Projects extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return <div>
        <Iframe url="https://www.furaffinity.net/user/rakkantekicoyote/"
        width="650px"
        height="550px"
        id="jsClass"
        className="mangaShop"
        display="initial"
        position="relative"/>
        </div>
    }
}
